import { Link } from "react-router-dom";
import '../../../node_modules/font-awesome/css/font-awesome.min.css';

const CartIcon = ({count}) => {
    return (
        <div className="cart">
            <Link to='/cart'>
                <i className="fa fa-shopping-cart">
                    <sup>
                        <sup>{count}</sup>
                    </sup>
                </i>
            </Link>
        </div>

    );
}

export default CartIcon;
